import React from "react";
import { Title, LoginTextField, LoginButton } from "./Materials";
import { Link } from "react-router-dom";
import { Typography } from "@material-ui/core";
import { config } from "../../config/Config";
import { PublicClientApplication } from "@azure/msal-browser";
import GoogleLogin from "react-google-login";
import { useHistory } from "react-router-dom";

const Home = () => {
  const history = useHistory();

  function handleClick() {
    history.push("/email")
    console.log(history)
  }

  const responseGoogle = (response) => {
    console.log(response);
    console.log()
  }

  return (
    <div class="h-full">
      <form
        class="h-full flex flex-wrap content-center justify-center flex-col"
        noValidate
        autoComplete="off"
      >
        <div class="text-center mb-6">
          <Title variant="h2" colorPrimary="white">
            AutoSend
          </Title>
        </div>

        <GoogleLogin
          clientId="326577504864-69qm9g7tk5ofitngtta9rn671a5rgj2b.apps.googleusercontent.com"
          buttonText="Login with Google"
          theme="dark"
          onSuccess={responseGoogle}
          onFailure={responseGoogle}
          cookiePolicy={'single_host_origin'}
        />

      </form>
    </div>
  );
};

export default Home;
